%spark


// These functions will be useful later on.

def distributionEntropy (v: DenseVector) : Double = {
    var h_sum = 0.0;

    for( i <- 1 until v.size) { 
         val next_prob = v.apply(i)

         if(next_prob > 1.0e-10) {
             h_sum -= (next_prob * Math.log(next_prob))
         }
     }

    return h_sum
};

// N.B: This is rho + C, for some constant C = h(f). 
def klDivergence (label: Int, v: DenseVector) : Double = {
    val next_prob = v.apply(label)

    // N.B: This can be used to avoid infinite rho values, for graphing purposes.
    // if(next_prob < 1.0e-30) {
    //     return -Math.log(1.0e-30)
    //     }

    return -Math.log(next_prob)
};

def bool2number(b:Boolean) : Double =  { if (b) {return 1.0} else {return 0.0} }

// Unpack the probability vector to a more useful form.
val toArr: Any => Array[Double] = _.asInstanceOf[DenseVector].toArray

// Generate udfs, so we can apply these to our data. 
val distH = udf(distributionEntropy _)
val rho = udf(klDivergence _)
val boolToNumber = udf(bool2number _)
val toArrUdf = udf(toArr)

def expandColumns (raw : DataFrame) : DataFrame = {
    var expanded = raw.withColumn("prob_array",toArrUdf($"probability"))
    expanded = expanded.withColumn("prob_p", $"prob_array"(0)).withColumn("prob_c", $"prob_array"(1)).withColumn("prob_3", $"prob_array"(2))
    expanded = expanded.withColumn("actual_p", boolToNumber($"next_status" === 0)).withColumn("actual_c", boolToNumber($"next_status" === 1)).withColumn("actual_3", boolToNumber($"next_status" === 2))
    expanded = expanded.withColumn("distEntropy", distH($"probability")).withColumn("rho", rho($"next_status", $"probability"))
    return expanded;
};



