def filterData (raw : DataFrame) : DataFrame = {
    var df_filtered = raw.filter($"MTM_LTV" > 0.0).filter($"MTM_LTV" < 2.0);
    df_filtered = df_filtered.filter($"INCENTIVE" > -1.0).filter($"CREDIT_SCORE" > 0);
    df_filtered = df_filtered.filter($"NEXT_STATUS" >= 0).filter($"NEXT_STATUS" <= 2);
    df_filtered = df_filtered.filter($"AGE" >= 0).filter($"STATUS" === 1);
    return df_filtered;
};


def centerColumn (exemplar : DataFrame, raw_data : DataFrame, column_name : String, column_renamed : String) : DataFrame = {
    val target_col = exemplar(column_name);
    val col_mean : Double = exemplar.select(avg(target_col)).collect()(0)(0).asInstanceOf[Double]
    val col_dev : Double = exemplar.select(stddev_pop(target_col)).collect()(0)(0).asInstanceOf[Double]

    val output_col = raw_data(column_name);
    val output_data = raw_data.withColumn(column_renamed, (output_col - col_mean) / col_dev);
    return output_data;
}

def assembleCenteredFeatures (exemplar : DataFrame, raw_data : DataFrame, feature_cols : Array[String]) : DataFrame = {
    val remapped = feature_cols.map(a => a + "_normalized");

    var updated = raw_data;

    for(i <- 0 until feature_cols.size) {
       updated = centerColumn(exemplar, updated, feature_cols(i), remapped(i));
    }

    val assembler = new VectorAssembler().setInputCols(remapped).setOutputCol("features");
    updated = assembler.transform(updated);

    for(i <- 0 until feature_cols.size) {
      updated = updated.drop(remapped(i));
    }

    return updated;
}

